import React from "react";
import AddUserForm from "../../FormComponent/AirportForm/AddAirport";

const CreateAirports = () => {
  return (
    <div style={{ color: "#fff" }}>
      <h3
        style={{ textAlign: "center", marginTop: "10vh", marginBottom: "3vh" }}
      >
        CREATE AIRPORTS
      </h3>
      <AddUserForm />
    </div>
  );
};
export default CreateAirports;
